In the wasmer runtime, which is what I've most experience with, there are two contexts to call exported functions in: on an Instance, that is, once a compiled module is instantiated (we'll come back to that), and from a Ctx, that is, from inside an imported function call. The first is highly ergonomic, the other not very (this will probably improve going forward, there's no reason not to). let func: Func<(i32, i32)> = instance.func("foo_functer")?;
let res = func.call(42, 43)?; To call from a Ctx, the best way currently is to pre-emptively (before instantiating) obtain the indices of the exported functions you want to call from the compiled module, and then call into the Ctx using those indices: // after compiling, with a Module
let export_index = module .info() .exports .get("foo_functer") .unwrap(); let func_index = if let ExportIndex::Func(func_index) = export_index { unsafe { std::mem::transmute(*func_index) }
} else { panic!("aaah");
} // inside an imported function, with a Ctx
let foo = 42;
let fun = 43; let res = ctx.call_with_table_index( func_index, &[WasmValue::I32(foo as _), WasmValue::I32(fun as _)],
)?;

