Something that is not obvious at first glance is that multi-value returns in wasm is comparatively young and not very well supported, which presents nasty surprises when trying to use it in all but the most trivial cases. Multi-value [return] is when wasm functions support multiple return values instead of just one: (func $readTwoI32s (param $offset i32) (result i32 i32) (i32.load (local.get $offset)) (i32.load (i32.add (local.get $offset) (i32.const 4)))
) To compile that with wat2wasm, you need the --enable-multi-value flag, which should have been a... flag... that this wasn't quite as well-supported as the current spec made it out to be. However, wasmer supports multi-value like a champ, both for calling exports: let func: Func<(i32), (i32, i32)> = instance.func("read_two_i32s")?;
let (one, two) = func.call(0)?; and for defining imports: imports! { "env" => { "get_two_i64s" => func!(|| -> (i64, i64) { (41, 42) }), },
}; That initially lulled me in a false sense of security and I went about designing APIs using multi-value and testing them with multi-value hand-written wat. All seemed great! Then I tried using Rust to write wasm modules that used my APIs and everything fell apart because Rust does not support multi-value for Wasm... and lies to you when you try using it. See, Rust uses some kind of "C-like" ABI to do the codegen for its imports and exports in its wasm support, such that if you write this: extern { fn get_two_i64s() -> (i64, i64);
} with multi-value you might expect this wasm: (func (export "get_two_i64s") (result i64 i64)) but what you actually get is this: (func (export "get_two_i64s") (param i32)) Uhhh??? What Rust is actually exporting is a function that would look like this: extern { fn get_two_i64s(pointer_to_write_to: u32);
} which you'd then call like: let mut buf: [i64; 2] = [0; 2];
unsafe { get_two_i64s(buf.as_mut_ptr()); }
let [a, b] = buf; So now both sides have to know that get_two_i64s expects to write two i64s contiguously somewhere in memory you specify, and then you retrieve that. The wasmrust "framework" does support multi-value. It doesn't magically activate a hidden rustc flag to enable multi-value codegen, though: it post-processes the wasm , looks for "things that look like they're multi-value functions", and writes them a wrapper that is multi-value , leaving the originals in place so you can use both styles. What the actual fuck. I'm sure it works great with the limited API style that wasmrust's bindgen macros write out, and I'm sure it was a lot easier to do this than to add multi-value support to Rustc, but it sure seems like a huge kludge. Anyway, so: multi-value is sexy, but don't even bother with it.
